import React from 'react';

function Contact() {
    return (
        <div id='contact'>
            <h1>Send Me Email</h1>
            <div className='contact-input'>
                <input type='email' placeholder='example@gmail.com'/>
                <a href='#'>Contact</a>
            </div>
        </div>
    )
}

export default Contact;
